css:
@-moz-document domain(roblox.com)
{
 @keyframes rainbow
  {
    0% {background-color: #A50BDE;
    border-color: #A50BDE;
  }

  14%
  {
    background-color: #6600F5;
    border-color: #6600F5;
  }

  28%
  {
    background-color: #250CFA;
    border-color: #250CFA;
  }

  42%
  {
    background-color: #0D3EFA;
    border-color: #0D3EFA;
  }

  56%
  {
    background-color: #0B6EDE;
    border-color: #0B6EDE;
  }

  80%
  {
    background-color: #00B5F5;
    border-color: #00B5F5;
  }

  94%
  {
    background-color: #0BDDDE;
    border-color: #0BDDDE;
  }

  100%
  {
    background-color: #0DFAB8;
    border-color: #0DFAB8;
  }
}

.btn-common-play-game-lg
{
  animation: rainbow 18s infinite;
}
}
